import React from 'react'
import { Link } from 'react-router-dom'
import {Box, AppBar, Typography, Avatar, Button} from '@mui/material'
import dogLogo from '../assets/dogLogo.png'

function Navbar() {
    const user = null
    
    return (
        <AppBar 
            position="static" 
            color="inherit"
            sx={{
                borderRadius: 4,
                p: 2,
                // my: 3,
                display: 'flex',
                flexDirection: 'row',
                justifyContent: 'space-between',
                alignItems: 'center',
            }}
        >
            <Box
                sx={{
                    display: 'flex',
                    flexDirection: 'row'
                }}
            >
                <Typography
                    variant="h2"
                    align="center"
                    component={Link}
                    to="/"
                >
                    PetSocial
                </Typography>
                
                <Box
                    sx={{
                    mx: 5,
                    }}
                >
                    <img
                        src={dogLogo}
                        alt="logo"
                        height="75"
                        // Image source: https://www.vecteezy.com/vector-art/5162048-cartoon-dog-walking-on-white-background "Dog Vectors by Vecteezy" submitted by user tigatelu
                    />
                </Box>
            </Box>

            {user ? (
                <Box
                    sx={{
                        display: 'flex',
                        flexDirection: 'row'
                    }}
                >
                    <Avatar>Avatar Here</Avatar>
                    <Typography>Typog</Typography>
                    <Button variant="contained" color="secondary">Button</Button>
                </Box>
            ) : (
                <Box
                    sx={{
                        display: 'flex',
                        flexDirection: 'row',
                        px: 2
                    }}
                >
                    <Button component={Link} to="/auth" variant="contained">Sign In</Button>
                </Box>
            )}
        </AppBar>
    )
}

export default Navbar
